emmm，这题太水了，乘法不用高精

```cpp
#include<bits/stdc++.h>
using namespace std;
int main()
{
	long long a,b;
	cin>>a>>b;
	cout<<a*b<<endl;
	return 0;
}
```

看数据，a和b最大1 000，积才1 000 000，所以普通运算就ok。

 _ 代码如下：_
```
var
    a,b:longint;
begin
    readln(a,b);
    writeln(a*b);
end.
```

# 题解 AT997 【Code Formula 2015】
------------
使用C实现A*B...

code：
```c
#include<stdio.h>
int main(){
	int a, b;
	scanf("%d%d", &a, &b);
	printf("%d", a*b);
	return 0;
}
```
